import { Fragment } from "react";

const Form = () => {
    return (
        <Fragment>
            <div>
                <p>Email</p>
                <input />
                <p>Password</p>
                <input />
                <p>By clicking Agree & Join, you agree to the LinkedIn <span style={{color: "blue"}}>User Agreement</span> , Privacy Policy, and Cookie Policy. </p>
            </div>
        </Fragment>
    )
}
export default Form;
